from collections import deque, defaultdict
class Solution(object):
    def minJumps(self, arr):
        """
        :type arr: List[int]
        :rtype: int
        """
        length = len(arr)
        dct_num_pos = defaultdict(list)
        for i in range(len(arr)):
            dct_num_pos[arr[i]].append(i)
        lst_bfs = deque([[0,0]])
        set_reached_node = set()
        set_reached_node.add(0)
        while len(lst_bfs) > 0:
            pos, depth = lst_bfs.popleft()
            if pos == length - 1:
                return depth
            else:
                if pos + 1 < length and (pos + 1) not in set_reached_node:
                    lst_bfs.append([pos + 1, depth + 1])
                    set_reached_node.add(pos + 1)
                if pos - 1 >= 0 and (pos - 1) not in set_reached_node:
                    lst_bfs.append([pos - 1, depth + 1])
                    set_reached_node.add(pos - 1)
                if arr[pos] in dct_num_pos:
                    for pos_candi in dct_num_pos[arr[pos]]:
                        if pos_candi not in set_reached_node:
                            lst_bfs.append([pos_candi, depth + 1])
                            set_reached_node.add(pos_candi)
                    del dct_num_pos[arr[pos]]
        return -1
